          "text": "<span id=\"docs-internal-guid-608c6c96-7fff-b8dc-ccbd-18898bbbe31d\"><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 11pt; font-family: Arial, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; white-space-collapse: preserve;\"><img src=\"data:image/png;base64,\" alt=\"\" style=\"font-size: 13px; color: rgb(255, 255, 255); font-family: Helvetica, Arial, sans-serif;\">也稱為中國鵯或光通風鵯，鵯科</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 11pt; font-family: Arial, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; white-space-collapse: preserve;\">身長約 19 公分（7.5 吋）。它有黑色的頭冠和鬍鬚條紋，後頸和黑色頭部的兩側覆蓋著白色的斑塊。它從眼睛到後腦勺都有白色的羽毛。上部灰棕色，夾雜著橄欖色。翅膀和尾巴是棕色的，邊緣有亮橄欖色。下體白色，胸帶呈淺棕色。它很吵鬧，唱歌非常明亮，變化多端，發出“ cha-ko-lee...cha-ko-lee...”的聲音。</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 11pt; font-family: Arial, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; white-space-collapse: preserve;\">是一種常見的鳴禽，喜歡樹木茂密的棲息地，經常可以在分佈範圍內的城鎮、郊區和城市公園看到它。</span></p><div><span style=\"font-size: 11pt; font-family: Arial, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; white-space-collapse: preserve;\"><br></span></div></span>"
