          "text": "<span id=\"docs-internal-guid-bf9be4b2-7fff-bbc6-84cf-113a3eebf6c5\"><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 11pt; font-family: Arial, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; white-space-collapse: preserve;\"><img src=\"data:image/png;base64,\" alt=\"\" style=\"font-size: 13px; color: rgb(255, 255, 255); font-family: Helvetica, Arial, sans-serif;\">也叫做斯泰恩鵯。是台灣東部和南部的特有種鵯。儘管在某些地區很常見，但它已被列為易滅絕物種，因為牠的棲息地遭到破壞以及與近緣鵯或白鵯的雜交。這兩個物種的分佈範圍在幾個地區有重疊，部分原因是後一種鳥類被釋放用於佛教儀式，該物種已在宜蘭縣（台灣）滅絕。</span></p><span style=\"font-size: 11pt; font-family: Arial, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; white-space-collapse: preserve;\">烏頭翁的外觀與白頭翁非常相似，但它們頭部的圖案有所不同。烏頭翁有一個完全黑色的冠，眼睛周圍有白色的羽毛，除了喙下方有黑色的鬍鬚條紋。雜交種介於這兩個物種之間，眼睛周圍有鬍鬚條紋和白色羽毛，但白色羽毛延伸到冠后。</span></span>"
